OutputStream output = new BufferedOutputStream(getOutputStream());
cachedContent = new byte[(int) dfosFile.length()];
new FileInputStream(dfosFile).read(cachedContent);

OutputStream output = null;
if (dfosFile != null) {
    output = new FileOutputStream(dfosFile);
} else {
    cachedContent = new ByteArrayOutputStream();
    output = cachedContent;
}

OutputStream output = getOutputStream();
if (dfosFile != null) {
    FileInputStream fis = new FileInputStream(dfosFile);
    IOUtils.copy(fis, output);
    fis.close();
    dfosFile.delete();
    dfosFile = null;
}

OutputStream output = getOutputStream();
if (dfosFile != null) {
    cachedContent = new byte[(int) dfosFile.length()];
    IOUtils.readFully(new FileInputStream(dfosFile), cachedContent);
}

ByteArrayOutputStream output = getOutputStream();
if (dfosFile != null) {
    cachedContent = getFile();
}

